import { Container } from "react-bootstrap";
import "./bootstrap.min.css"
import ProductScreen from "./screens/ProductScreen";


const App = () => {
  return (

    <Router>

      <Header />
      <main className="py-3">
        <Container>
          <Route path = "/" component={Homescreen} exact/>
          <Route path ="producthcjbh/:id" component={ProductScreen}/>
        </Container>
      </main>

      <Footer />

      </Router>
  );
}

export default App;
